import React from "react";
import {STLViewer} from 'react-stl-obj-viewer';


function Stl(props){
    return(
      <STLViewer
      onSceneRendered={(element) => {
        console.log(element)
      }}
      width={props.size}
      height={props.size}
      sceneClassName="test-scene"
      file={props.file}
      className="stl"
      modelColor="#FFFFFF"
      backgroundColor='#FFFFFF'
      back
      /> 
)
};

export default Stl;
